  'AdminAdvparametersHelp' => 
  array (
    '-- Choose --' => '– Vyberte –',
    'or' => 'nebo',
    'Use this option to associate data (products, modules, etc.) the same way for each selected shop.' => 'Použít ke spojení dat (výrobky, moduly, atd.) stejným způsobem u vybrané prodejny',
    'Click here to display the shops in the %name% shop group' => 'Kliknutím sem zobrazíte obchody ve skupině obchodů %name%',
    'Click here to display the URLs of the %name% shop' => 'Kliknutím sem zobrazíte adresy URL obchodu %name%',
    'Click here to display the list of shop groups' => 'Kliknutím sem zobrazíte seznam skupin obchodů',
    'Warning: Enabling the "share customers" and "share orders" options is not recommended. Once activated and orders are created, you will not be able to disable these options. If you need these options, we recommend using several categories rather than several shops.' => 'Upozornění: není doporučeno povolit "sdílení zákazníků" a "sdílení objednávek", protože jakmile jsou tyto možnosti aktivovány a jsou vytvořeny zákazníci nebo objednávky, nebudete moci zakázat toto nastavení. Pokud potřebujete povolit tyto možnosti, zkuste nejdříve zvážit použití sdílení v několika kategoriích místo v několika obchodech.',
    'Once this option is enabled, the shops in this group will share customers. If a customer registers in any one of these shops, the account will automatically be available in the others shops of this group.' => 'Pokud je tato možnost povolena, obchody budou sdíleny vašim zákazníkům. Jakmile se zákazník zaregistruje na jednom z těchto eshopu, jeho účet bude automaticky dostupný ve všech obchodech ze skupiny.',
    'Warning: you will not be able to disable this option once you have registered customers.' => 'Varování: nemůžete vypnout tuto funkci, pokud už máte zaregistrované zákazníky.',
    'Once this option is enabled (which is only possible if customers and available quantities are shared among shops), the customer\'s cart will be shared by all shops in this group. This way, any purchase started in one shop will be able to be completed in another shop from the same group.' => 'Jakmile bude tato možnost povolena (což je možné pouze pokud obchody sdílí zákazníky a dostupné množství), zákazníkův košík bude sdílen ve všech obchodech ze skupiny. Pokud tedy zákazník začne nakupovat v jednom obchodě, bude moci nákup dokončit v jakémkoliv obchodě ze stejné skupiny.',
    'Warning: You will not be able to disable this option once you\'ve started to accept orders.' => 'Varování: nemůžete vypnout tuto funkci, pokud už máte nějaké objednávky.',
    'Enable or disable this shop group?' => 'Povolit nebo zakázat tuto skupinu obchodů?',
    'If you want to add a virtual URL, you need to activate URL rewriting on your web server and enable Friendly URL option.' => 'Chcete-li přidat virtuální adresu URL, musíte aktivovat přepisování URL na vašem webovém serveru a umožnit volbu Friendly URL (přátelské URL).',
    'You can use this option if you want to create a store with a URL that doesn\'t exist on your server (e.g. if you want your store to be available with the URL www.example.com/my-store/shoes/, you have to set shoes/ in this field, assuming that my-store/ is your Physical URL).' => 'Tuto volbu lze použít v případě, že potřebujete vytvořit obchod s adresou URL, která na Vašem serveru neexistuje (např. pokud chcete, aby byl Váš obchod dostupný na adrese URL www.priklad.cz/boty/, zadejte do tohoto pole "boty/" - za předpokladu, že fyzická adresa URL obchodu je www.priklad.cz).',
    'URL rewriting must be activated on your server to use this feature.' => 'Přepisování URL musí být aktivováno na vašem serveru, když chcete využívat tuto funkci.',
    'If you set this URL as the Main URL for the selected shop, all URLs set to this shop will be redirected to this URL (you can only have one Main URL per shop).' => 'Nastavíte-li tuto adresu jako hlavní URL pro vybraný obchod, budou všechny URL adresy obchodu přesměrovány na toto URL (můžete mít pouze jednu hlavní adresu URL pro obchod).',
    'Since the selected shop has no main URL, you have to set this URL as the Main URL.' => 'Vzhledem k tomu, že vybraný obchod nemá hlavní adresu URL, budete muset nastavit toto URL jako hlavní',
    'The selected shop already has a Main URL. Therefore, if you set this one as the Main URL, the older Main URL will be set as a regular URL.' => 'Zvolený obchod již hlavní adresu URL má. Pokud nastavíte tuto adresu jako hlavní, bude stará adresa nastavena jako běžná adresa URL.',
    'This is the physical folder for your store on the web server. Leave this field empty if your store is installed on the root path. For instance, if your store is available at www.example.com/my-store/, you must input my-store/ in this field.' => 'Toto je fyzická složka na serveru, ve které je umístěn Váš obchod. Pokud je Vás obchod nainstalován v kořenové složce, ponechte toto pole prázdné. Např. pokud je Váš obchod dostupný na adrese www.priklad.cz/obchod, bude v tomto poli hodnota "obchod/".',
    'Warning: URL rewriting (e.g. mod_rewrite for Apache) seems to be disabled. If your Virtual URL doesn\'t work, please check with your hosting provider on how to activate URL rewriting.' => 'Upozornění: přepisování URL (např. mod_rewrite pro Apache), je pravděpodobně zakázáno. Pokud vaše URL nefungují, poraďte se se svým poskytovatelem hostingu jak aktivovat přepisování URL.',
    'Ignore this field if you don\'t use the Multistore tool. If you leave this field empty, the default shop will be used.' => 'Ignorujte toto pole, pokud nechcete použít nástroj Multistore. Necháte-li toto pole prázdné, bude použit výchozí obchod',
    'A category root is where a category tree can begin. This is used with multistore.' => 'Hlavní kategorií je místo, kde začíná strom kategorií. Používá se v Multistore',
    'Enable Advanced Stock Management on product (0 = No, 1 = Yes)' => 'Aktivovat pokročilé řízení zásob (0=Ne, 1=Ano)',
    '0 = Use quantity set in product, 1 = Use quantity from warehouse.' => '0 = použít množství u produktu, 1 = použít množství ze řízení skladových zásob.',
    'ID of the warehouse to set as storage.' => 'ID skladu pro úložiště.',
    'Enable Advanced Stock Management on product (0 = No, 1 = Yes).' => 'Aktivovat pokročilé řízení zásob (0=Ne, 1=Ano).',
    'This will add directives to your .htaccess file, which should improve caching and compression.' => 'Tato funkce přidá pravidla do .htaccess souboru. Toto zlepší použití cache a komprese',
    'Enable or disable debug mode.' => 'Zapněte nebo vypněte režim ladění.',
    'Name of the second domain of your shop, (e.g. myshop-media-server-1.com). If you do not have another domain, leave this field blank.' => 'Název druhé domény vašeho obchodu (např. mujobchod-mediaserver-1.cz). Pokud nemáte jinou doménu, nechte toto políčko prázdné.',
    'Name of the third domain of your shop, (e.g. myshop-media-server-2.com). If you do not have another domain, leave this field blank.' => 'Název třetí domény vašeho obchodu (např. mujobchod-mediaserver-2.cz). Pokud nemáte jinou doménu, nechte toto políčko prázdné.',
    'Name of the fourth domain of your shop, (e.g. myshop-media-server-3.com). If you do not have another domain, leave this field blank.' => 'Název čtvrté domény vašeho obchodu (např. mujobchod-mediaserver-3.cz). Pokud nemáte jinou doménu, nechte toto políčko prázdné.',
    'Choose "No" to disable Product Combinations.' => 'Zvolte "NE" pro vypnutí kombinací produktů.',
    'You cannot set this parameter to No when combinations are already used by some of your products' => 'Nemůžete nastavit parametr na NE dokud jsou kombinace používány u některých z vašich produktů',
    'Choose "No" to disable Product Features.' => 'Zvolte "NE" pro vypnutí vlastností produktu.',
    'Choose "No" to disable Customer Groups.' => 'Zvolte "NE" pro vypnutí uživatelských skupin.',
    'Should be enabled if you want to avoid to store the smarty cache on NFS.' => 'Mělo by být povoleno, pokud se chcete vyhnout ukládání Smarty Cache na NFS.',
    'New modules and updates are displayed on the modules page.' => 'Nové moduly a jejich aktualizace jsou zobrazeny na stránce modulů.',
    'Check the IP address of the cookie in order to prevent your cookie from being stolen.' => 'Zkontrolujte adresu IP v cookie, aby se zabránilo odcizení cookie.',
    'Set the amount of hours during which the front office cookies are valid. After that amount of time, the customer will have to log in again.' => 'Zadejte počet hodin, po které budou platné cookies obchodu. Po uplynutí tohoto času se bude muset zákazník přihlásit znovu.',
    'When you access your back office and decide to stay logged in, your cookies lifetime defines your browser session. Set here the number of hours during which you want them valid before logging in again.' => 'Když přistupujete do své administrace a rozhodnete se zůstat přihlášeni, doba trvání Vašich cookies definuje Vaši relaci prohlížeče. Před opětovným přihlášením zde nastavte počet hodin, po které mají být platné.',
    'Choose a stability level for the modules downloaded from the Addons Marketplace. All zips pushed on Addons are in stable state unless stated otherwise.' => 'Vyberte úroveň stability pro moduly stažené z Addons Marketplace. Všechny instalační archivy jsou ve stabilní verzi, pokud není uvedeno jinak.',
    'Allows you to declare if your cookie should be restricted to a first-party or same-site context.' => 'Dovoluje upřesnit, jestli má být cookie omezena na first-party nebo same-site kontext.',
    'Define the upload limit for a downloadable product (in megabytes). This value has to be lower or equal to the maximum file upload allotted by your server (currently: %size% MB).' => 'Definujte limit pro nahrávání produktu, který je k dispozici online (v Megabytech). Tato hodnota musí být menší nebo rovna direktivě PHP, která definuje maximální velikost souboru (v současnosti: %size% MB).',
    'Define the upload limit for an image (in megabytes). This value has to be lower or equal to the maximum file upload allotted by your server (currently: %size% MB).' => 'Definujte limit pro nahrávání obrázku (v MB). Tato hodnota musí být menší nebo rovna maximální hodnotě pro nahrávání souboru přidělené serverem (v současné době: %size% MB).',
    'Set the maximum size allowed for attachment files (in megabytes). This value has to be lower than or equal to the maximum file upload allotted by your server (currently: %size% MB).' => 'Nastavte maximální povolenou velikost souborů příloh (v megabajtech). Tato hodnota by měla být nižší nebo shodná s maximální velikostí pro nahrávání souborů vašeho serveru (aktuálně: %size% MB).',
    'Drop existing tables during import.' => 'Odstranit při importu existující tabulky.',
    'If enabled, the backup script will drop your tables prior to restoring data. (ie. "DROP TABLE IF EXISTS")' => 'Pokud je povoleno, zálohovací skript odstraní vaše tabulky před obnovou dat. (Spustí příkaz "DROP TABLE IF EXISTS".)',
    'Where customers send messages from the order page.' => 'Kde zákazníci odesílají zprávy ze stránky objednávky',
    'Fully qualified domain name (keep this field empty if you don\'t know).' => 'Plně kvalifikovaný název domény (pokud nevíte, ponechte prázdné)',
    'IP address or server name (e.g. smtp.mydomain.com).' => 'IP adresa nebo název serveru (např.: smtp.mojedomena.cz).',
    'Leave blank if not applicable.' => 'Pokud toto není použitelné, ponechte prázdné',
    'SSL does not seem to be available on your server.' => 'SSL se zdá být nedostupné na vašem serveru.',
    'Port number to use.' => 'Číslo portu.',
    'If enabled, the product\'s reference number MUST be unique!' => 'Pokud je povoleno, MUSÍ BÝT kód zboží unikátní!',
    'e.g. 1; Blouse; 129.90; 5' => 'např.: 1; Blouse; 129.90; 5',
    'e.g. Blouse; red.jpg, blue.jpg, green.jpg; 129.90 ' => 'např. Blouse; red.jpg, blue.jpg, green.jpg; 129.90 ',
    'Enable this option to keep your imported items’ ID number as is. Otherwise, PrestaShop will ignore them and create auto-incremented ID numbers.' => 'Pokud povolíte tuto volbu, PrestaShop vezme ID importovaných položek tak jak jsou. Jinak je bude ignorovat a automaticky vezme další volné ID v řadě.',
