    'Download the backup from the list below or from your FTP server (in the folder "admin/backups").' => 'Stáhněte si zálohu ze seznamu níže nebo přes FTP (z adresáře "admin/backups").',
    'Check the backup integrity: Look for errors, incomplete file, etc... Be sure to verify all of your data.' => 'Kontrola integrity zálohy: hledání chyb, neúplných souborů atd. Ověřte všechna vaše data.',
