    'If your backup file exceeds this limit, contact your hosting provider for assistance. ' => 'Pokud váš záložní soubor překračuje tento limit kontaktujte svého poskytovatele webhostingu. ',
    'Click on the "Go" button and please wait patiently for the import process to conclude. This may take several minutes.' => 'Klikněte na tlačítko "Provést" a počkejte na dokončení importu. Tento proces může trvat několik minut.',
    'Click on the "%phpmyadmin_browse_label%" button and select the backup file from your hard drive.' => 'Klikněte na tlačítko "%phpmyadmin_browse_label%" a vyberte záložní soubor ze svého pevného disku.',
    'Click on the "%phpmyadmin_go_label%" button and please wait patiently for the import process to conclude. This may take several minutes.' => 'Klikněte na tlačítko "%phpmyadmin_go_label%" a počkejte na dokončení importu. Tento proces může trvat několik minut.',
