    'e.g. ' => 'např.',
    'If you enable this option, your imported items\' ID number will be used as is. If you do not enable this option, the imported ID numbers will be ignored, and PrestaShop will instead create auto-incremented ID numbers for all the imported items.' => 'Pokud povolíte tuto volbu, ID čísla vašich importovaných položek budou použity v původních tvarech. Pokud tuto volbu nepovolíte, importované ID čísla se budou ignorovat a místo nich PrestaShop vytvoří pro všechny importované položky vlastní, automaticky se zvyšující ID čísla.',
    'Sends an email to let you know your import is complete. It can be useful when handling large files, as the import may take some time.' => 'Odešle informační e-mail o dokončení importu. Při práci s většími soubory to může být užitečné, protože import bývá časově náročný.',
    'Read more about the CSV format at:' => 'Přečtěte si více o formátu CSV na:',
