    'Your avatar in PrestaShop 1.7.x is your profile picture on %url%. To change your avatar, log in to PrestaShop.com with your email %email% and follow the on-screen instructions.' => 'Váš avatar v PrestaShop 1.7.x je váš profilový obrázek na %url%. Pro změnu avataru se přihlašte do PrestaShop.com pomocí vašeho emailu %email% a následujte instrukce na obrazovce.',
    'Password should be at least %num% characters long.' => 'Heslo by mělo být alespoň %num% znaků dlouhé.',
