    'Set the amount of hours during which the back office cookies are valid. After that amount of time, the PrestaShop user will have to log in again.' => 'Zadejte počet hodin, po které budou platná cookies administrace. Po uplynutí tohoto času se bude muset uživatel Prestashopu přihlásit znovu.',
