    'Notifications are numbered bubbles displayed at the very top of your back office, right next to the shop\'s name. They display the number of new items since you last clicked on them.' => 'Upozornění jsou bublinky s číslem, které jsou zobrazeny v horní části administrace, hned vedle názvu obchodu. Zobrazují počet nových položek od doby, kdy na ně bylo naposledy kliknuto.',
