    'CCC allows you to reduce the loading time of your page. With these settings you will gain performance without even touching the code of your theme. Make sure, however, that your theme is compatible with PrestaShop 1.7+. Otherwise, CCC will cause problems.' => 'CCC dovoluje snížit čas načítání vaší stránky. S tímto nastavením získáte vyšší výkon bez zásahu do kódu nebo šablony. Ujistěte se, že vaše šablona je kompatibilní s PrestaShop 1.7+. Jinak může CCC způsobit problémy.',
    'This page benefits from increased performance and includes new features such as a new combination management system. Please note this is a work in progress and some features are not available yet.' => 'Tato stránka má vyšší výkon a nové funkce, jako je vylepšená správa kombinací. Upozorňujeme, že je však stále ve vývoji a některé funkce nejsou dosud dostupné.',
