    'You should calculate this percentage as follows: ((total sales revenue) - (cost of goods sold)) / (total sales revenue) * 100. This value is only used to calculate the Dashboard approximate gross margin, if you do not specify the wholesale price for each product.' => 'Měli by jste tuto procentní sazbu vypočítat jako podíl: ((celkové tržby) - (náklady na prodané zboží)) / (celkové tržby) * 100. Tato hodnota se používá pouze k výpočtu přibližné hrubé marže na nástěnce, pokud nezadáte velkoobchodní ceny pro každý produkt.',
    'You should calculate this value by making the sum of all of your additional costs per order.' => 'Měli by jste tuto hodnotu vypočítat tak, že sečtete všechny své dodatečné náklady na objednávku.',
