  'AdminDesignNotification' => 
  array (
    'Your page will be saved as a draft' => 'Vaše stránka bude uložena jako rozepsaná',
    'You can choose to keep your images stored in the previous system. There\'s nothing wrong with that.' => 'Můžete ponechat ukládání obrázků pomocí staršího systému – není na něm nic špatného.',
    'You can also decide to move your images to the new storage system. In this case, click on the "Move images" button below. Please be patient. This can take several minutes.' => 'Můžete se také rozhodnout pro přesun obrázků do nového systému ukládání: v tomto případě klikněte na "Přesunout obrázky" níže. Buďte trpěliví, může to trvat několik minut.',
    'After moving all of your product images, set the "Use the legacy image filesystem" option above to "No" for best performance.' => 'Pro lepší výkon, přejděte po přesunu všech vašich obrázků na záložku "Použití starého souborového systému pro obrázky" a nastavte "Ne".',
    'Be careful! Depending on the options selected, former manually uploaded thumbnails might be erased and replaced by automatically generated thumbnails.' => 'Opatrně! V závislosti na vybraných možnostech se může stát, že se ručně nahrané miniatury přepíší těmi automaticky generovanými.',
    'Also, regenerating thumbnails for all existing images can take several minutes, please be patient.' => 'Dále, generování miniatur pro všechny obrázky může trvat několik minut, buďte trpěliví.',
    'If you want to order/move the following data, please select a shop from the shop list.' => 'Pokud si chcete uspořádat / přesunout tyto údaje, zvolte obchod ze seznamu',
    'Current theme is unavailable. Please check your theme\'s directory name ("%s") and permissions.' => 'Aktuální šablona není k dispozici. Zkontrolujte název adresáře šablony ("%s) a oprávnění pro zápis.',
    'No items found' => 'Žádné položky nebyly nalezeny',
    'Duplicate images were found when moving the product images. This is likely caused by unused demonstration images. Please make sure that the folder %folder% only contains demonstration images, and then delete it.' => 'Při přesouvání obrázků byly nalezeny duplicitní obrázky. Je to pravděpodobně způsobeno nepoužívanými demo obrázky. Ujistěte se prosím, že složka %folder% obsahuje pouze demonstrační obrázky a potom ji smažte.',
    'Incorrect value for the selected JPEG image compression.' => 'Nesprávná hodnota pro vybranou JPEG kompresi obrazu.',
    'Incorrect value for the selected PNG image compression.' => 'Nesprávná hodnota pro vybranou JPEG kompresi obrazu.',
