    'Original image is corrupt (%filename%) for product ID %id% or bad permission on folder.' => 'Původní obrázek (%filename%) pro produkt č. %id% je poškozen nebo je ve složce nastaveno nesprávné oprávnění.',
    'Original image is missing or empty (%filename%) for product ID %id%' => 'Původní obrázek (%filename%) pro produkt č. %id% chybí nebo je prázdný',
    'Cannot write images for this type: %1$s. Please check the %2$s folder\'s writing permissions.' => 'Nelze zapsat obrázky tohoto typu: %1$s. Zkontrolujte, zda lze do složky %2$s zapisovat.',
    'Only part of the images have been regenerated. The server timed out before finishing.' => 'Regenerace obrázků byla pouze částečná. Vypršel čas nastavený na serveru.',
    'Server timed out. The watermark may not have been applied to all images.' => 'Vypršel časový limit. Vodotisk možná nebyl aplikován na všechny Vaše obrázky.',
    'Cannot write "No picture" image to %s images folder. Please check the folder\'s writing permissions.' => 'Nelze uložit obrázek "Obrázek neexistuje" do složky %s. Zkontrolujte oprávnění složek pro zápis.',
    'Error: Your server configuration is not compatible with the new image system. No images were moved.' => 'Chyba: konfigurace serveru není kompatibilní s novým systémem obrázků. Žádné obrázky nebyly přesunuty',
    'Not all images have been moved. The server timed out before finishing. Click on "Move images" again to resume the moving process.' => 'Ne všechny obrázky byly přesunuty, před dokončením vypršel časový limit serveru. Klikněte na "Přesunout obrázky" na obnovení přesunu obrázků',
    'Error: Some -- or all -- images cannot be moved.' => 'Chyba: některé nebo všechny obrázky nemohly být přesunuty.',
    'After modification, do not forget to regenerate thumbnails' => 'Po změně nezapomeňte přegenerovat miniatury',
    'Not all images have been moved. The server timed out before finishing. Click on "%move_images_label%" again to resume the moving process.' => 'Ne všechny obrázky byly přesunuty. Před dokončením vypršel časový limit serveru. Klepněte na "%move_images_label%" pro pokračování s přesunem obrázků.',
    'The uploaded file is too large.' => 'Nahraný soubor je příliš velký.',
    'Failed to move uploaded file.' => 'Přesunutí nahraného souboru se nezdařilo.',
    'This theme is not valid for PrestaShop 1.7' => 'Tato šablona není kompatibilní s PrestaShop 1.7',
    'An error occurred. The information "%s" is missing.' => 'Vyskytla se chyba. Informace "%s" chybí.',
    'An error occurred. The template "%s" is missing.' => 'Stala se chyba. Šablona "%s" chybí.',
    'An error occurred while uploading the favicon: cannot copy file "%s" to folder "%s".' => 'Došlo k chybě při nahrávání favicon: nelze kopírovat soubor "%s" do složky "%s".',
    'Your theme has been correctly exported: %path%' => 'Vaše šablona byla úspěšně exportována: %path%',
    'The page Category cannot be moved here.' => 'Stránku Kategorie nelze přesunout sem.',
    'Your RTL stylesheets has been generated successfully' => 'Vaše RTL styly byly úspěšně vygenerovány',
    'Your theme has been correctly reset to its default settings. You may want to regenerate your images. See the Improve > Design > Images Settings screen for the \'Regenerate thumbnails\' button.' => 'U vaší šablony vzhledu se podařilo obnovit původní nastavení. Možná budete chtít regenerovat své obrázky. Viz Rozšíření > Vzhled > Nastavení obrázků a zde se nachází tlačítko "Regenerovat miniatury".',
    'There is already a theme %theme_name% in your themes folder. Remove it if you want to continue.' => 'Ve složce šablon již existuje šablona s názvem %theme_name%. Chcete-li pokračovat, odstraňte ji.',
    'Failed to delete theme. Make sure you have permissions and theme is not used.' => 'Šablonu se nepodařilo odstranit. Ujistěte se, že máte potřebná oprávnění a šablona se nepoužívá.',
    'Cannot adapt theme to RTL languages.' => 'Šablonu nelze přizpůsobit RTL jazykem.',
    'Your theme has been correctly reset to its default settings. You may want to regenerate your images. See the Improve > Design > Images Settings screen for the \'%regenerate_label%\' button.' => 'Vaše šablona byla úspěšně resetována do výchozích nastavení. Možná budete chtít regenerovat obrázky. Podívejte se do sekce Vzhled > Nastavení obrázků a použijte tlačítko "%regenerate_label%".',
    'This name already exists.' => 'Toto jméno již existuje.',
    'Invalid file format.' => 'Neplatný formát souboru.',
    'Warning: if no email logo is available, the main logo will be used instead.' => 'Varování: pokud není k dispozici žádné logo e-mailu, potom bude použito hlavní logo.',
