    'Edit information about your pages to gain visibility and therefore reach more visitors. We advise you to start with the index page, it stands for your homepage.' => 'Upravte informace o svých stránkách, abyste získali zviditelnění a tím oslovte více návštěvníků. Doporučujeme vám, abyste začali indexovou stránkou, což znamená vaše domovská stránka.',
