    'Total customer accounts:' => 'Celkový počet zaregistrovaných zákazníků:',
    'Number of customer accounts created' => 'Počet vytvořených účtů',
    'The total number of accounts created is not in itself important information. However, it is beneficial to analyze the number created over time. This will indicate whether or not things are on the right track. You feel me?' => 'Celkový počet vytvořených registrací není sám o sobě příliš důležitý. Nicméně je vhodné sledovat, jak se mění jejich počet v průběhu nějakého časového intervalu. To vám naznačí, zda trend, kterým se Váš obchod ubírá, je správný.',
    'How to act on the registrations\' evolution?' => 'Návod jak zajistit nárůst registrací.',
    'If you let your shop run without changing anything, the number of customer registrations should stay stable or show a slight decline.' => 'Pokud ve svém obchodě nebude nic měnit, může se počet registrací zákazníků časem ustálit, nebo dokonce může začít mírně klesat.',
    'A significant increase or decrease in customer registration shows that there has probably been a change to your shop. With that in mind, we suggest that you identify the cause, correct the issue and get back in the business of making money!' => 'Významný nárůst nebo pokles registrací ukazuje, že pravděpodobně došlo k nějaké změně ve vašem e-shopu. Je na vás, abyste na tento fakt zareagovali – návratem, nebo naopak podporou případných změn!',
    'Here is a summary of what may affect the creation of customer accounts:' => 'Zde je souhrn toho, co vše může mít vliv na vytváření zákaznických účtů:',
