    'Specials, sales, promotions and/or contests typically demand a shoppers\' attentions. Offering such things will not only keep your business lively, it will also increase traffic, build customer loyalty and genuinely change your current e-commerce philosophy.' => 'Akční nabídky, výprodeje nebo soutěže mohou přitáhnout větší pozornost návštěvníků a zvýšit ziskovost e-shopu.',
    'Design and user-friendliness are more important than ever in the world of online sales. An ill-chosen or hard-to-follow graphical theme can keep shoppers at bay. This means that you should aspire to find the right balance between beauty and functionality for your online store.' => 'Grafický design stejně jako uživatelská přívětivost jsou velice důležité faktory. Měli byste nalézt správnou rovnováhu mezi inovativním designem a snadnou orientací po stránce. To znamená, že by se měl snažit najít správnou rovnováhu mezi vizuální přitažlivosti a funkčností vašeho internetového obchodu.',
